    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT - - col1 NOT BETWEEN col2 - col1 AND ( + 83 * col1 / + col0 );
  - name: tab2

outputs:
  - name: q1649.out
    data: |
      46	51	23
      64	77	40
      75	67	58
